```
\documentclass{article}
\usepackage{tikz}
\usetikzlibrary{shapes.geometric, arrows.meta}

\tikzset{
    process/.style={rectangle, draw, minimum height=2em, minimum width=3em},
    decision/.style={diamond, aspect=2, draw, minimum height=2em, minimum width=3em},
    arrow/.style={-Stealth}
}

\begin{document}

\begin{tikzpicture}[node distance=1cm]
    \node (start) [process] {Start};
    \node (decision1) [decision, below of=start] {Decision 1};
    \node (process1) [process, below of=decision1] {Process 1};
    \node (decision2) [decision, below of=process1] {Decision 2};
    \node (process2) [process, below of=decision2] {Process 2};
    \node (end) [process, below of=process2] {End};

    \draw [arrow] (start) -- (decision1);
    \draw [arrow] (decision1) -- node[anchor=east] {Yes} (process1);
    \draw [arrow] (process1) -- (decision2);
    \draw [arrow] (decision2) -- node[anchor=east] {Yes} (process2);
    \draw [arrow] (process2) -- (end);
